import './App.css';
import Header from './Header.js';

function App() {
  return (
    <div className="App">
      <Header />
      <div className="container">
        <div className="column">
          <h2>Instructions</h2>
          <p style={{textAlign: "left"}}></p>
        </div>







        <div className="column">Column 2</div>
